import React from 'react';
import Jumbotron from '../components/Jumbotron';
import Card from '../components/Card';

function Books() {
    return (
        <div>
            <Jumbotron />
            <Card>
                <h3>What do you want to search for?</h3>
            </Card>
        </div>
    )
}

export default Books;
